<?php
function strStrDiy($haystack, $needle)
{
    if ($needle == '') {
        return 0;
    } else {
        $re = -1;
        $hLen = strlen($haystack);
        $nLen = strlen($needle);
        for ($i = 0; $i < $hLen; $i++) {
            if ($haystack[$i] == $needle[0]) {
                $tmp = $re;
                for ($j = 0; $j < $nLen; $j++) {
                    if ($hLen - $i < $nLen - $j) {
                        return -1;
                    } else {
                        if ($haystack[$i + $j] == $needle[$j]) {
                            $re = $i;
                        } else {
                            $re = $tmp;
                            break;
                        }
                    }
                }
            }
            if ($re != -1) {
                break;
            }
        }
        return $re;
    }
}

$h = '';
$n = '';
$s = microtime(true);
var_dump(strStrDiy($h, $n));
$n = microtime(true);
echo "用时" . ($n - $s) * 1000 . '毫秒';